import React, { useState, useEffect } from "react";
import axios from 'axios';

function ChangePersInfo({ close }) {
    const [name, setName] = useState(null);

    return (
        <div className="changePersInfo">
            <div className="inside">
                <div class="close" onClick={close}>
                    <svg width="17" height="17" viewBox="0 0 17 17" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M1 1L16 16" stroke="#9E9E9E" stroke-width="2"></path>
                        <path d="M1 16L16 1" stroke="#9E9E9E" stroke-width="2"></path>
                    </svg>
                </div>
                <h5>Общая информация</h5>
                <form>
                    <fieldset>
                        <input type='text' placeholder="Имя" min='2' onInput={(e)=>console.log(e.value)}/>
                        <label>Имя</label>
                    </fieldset>
                    <fieldset>
                        <input type='text' placeholder="Фамилия" min='2' />
                        <label>Фамилия</label>
                    </fieldset>
                    <button type="submit">Сохранить</button>
                </form>
            </div>
        </div>
    );
}

export default ChangePersInfo;
